import React, { useState } from 'react';
import './Portfolio.css';
import seaweedImage from './images/projects/seaweed/seaweed.png'; // Placeholder image
import droneImage from './images/projects/drone/drone.png'; // Placeholder image
import stockImage from './images/projects/stock.png'; // Placeholder image

// https://flagcdn.com/en/codes.json

const projects = [
  {
    id: 1,
    title: "Sustainable Seaweed Farming (Coming August 2025)",
    image: seaweedImage, // Add your project images
    description: "Master's thesis asssessing current practices and pathways for sustainable, equitable growth in the seaweed industry.",
    tags: ["Causal Loop Diagram", "Sustainability", "Resilience"],
    link: "",
    locations: [
      { name: "United Kingdom", code: "gb" },
      { name: "Philippines", code: "ph" },
      { name: "Tanzania", code: "tz" }
    ]
  },
  {
    id: 2,
    title: "Using Drones & Deep Learning to Monitor Oak Tree Health",
    image: droneImage, // Add your project images
    description: "Developed deep learning algorithm ROS2 and Python for use by an unmanned aerial vehicle (UAV) to inspect trees for Acute Oak Decline (AOD).",
    tags: ["Robotics", "ROS2", "Python", "Deep Learning", "YOLOv5"],
    link: "https://github.com/hgillesp12/aod_detection",
    locations: [
      { name: "United Kingdom", code: "gb" }
    ]
  },
  {
    id: 3,
    title: "Biosand Filter Design for Clean Water",
    image: stockImage, // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project",
    locations: [
      { name: "United States", code: "us" },
      { name: "Haiti", code: "ht" }
    ]
  },
  {
    id: 4,
    title: "Autonomous Robot Navigation",
    image: stockImage, // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project",
    locations: [
      { name: "United Kingdom", code: "gb" },
      { name: "Indonesia", code: "id" },
      { name: "Philippines", code: "ph" }
    ]
  },
  {
    id: 5,
    title: "Autonomous Robot Navigation",
    image: stockImage, // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project",
    locations: [
      { name: "United Kingdom", code: "gb" },
      { name: "Indonesia", code: "id" },
      { name: "Philippines", code: "ph" }
    ]
  },
  {
    id: 6,
    title: "Autonomous Robot Navigation",
    image: stockImage, // Add your project images
    description: "Developed autonomous navigation algorithms for mobile robots using ROS and Python.",
    tags: ["Robotics", "ROS", "Python"],
    link: "https://github.com/yourusername/project",
    locations: [
      { name: "United Kingdom", code: "gb" },
      { name: "Indonesia", code: "id" },
      { name: "Philippines", code: "ph" }
    ]
  },
  // Add more projects here
];

function ProjectModal({ project, onClose }) {
  const handleOverlayClick = (e) => {
    if (e.target.className === 'modal-overlay') {
      onClose();
    }
  };

  return (
    <div className="modal-overlay" onClick={handleOverlayClick}>
      <div className="project-modal">
        <div className="modal-button-panel">
          {project.buttons?.map((button, index) => (
            <a
              key={index}
              href={button.url}
              className="modal-button"
              target="_blank"
              rel="noopener noreferrer"
            >
              {button.text}
            </a>
          ))}
        </div>

        <div className="project-content">
          <button className="modal-close" onClick={onClose}>&times;</button>
          <h2>{project.title}</h2>
          <img src={project.image} alt={project.title} />
          <p>{project.description}</p>

          <div className="project-tags">
            {project.tags.map(tag => (
              <span key={tag} className="tag">{tag}</span>
            ))}
          </div>
        </div>

        {project.locations && (
          <div className="project-flags">
            {project.locations.map((location, index) => (
              <div key={index} className="project-location">
                <img 
                  src={`https://flagcdn.com/${location.code}.svg`} 
                  alt={location.name} 
                />
                <span>{location.name}</span>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

function Portfolio() {
  const [selectedProject, setSelectedProject] = useState(null);

  return (
    <section className="portfolio-section">
      <h3>Portfolio</h3>
      <div className="portfolio-grid">
        {projects.map(project => (
          <div
            key={project.id}
            className="portfolio-tile"
            onClick={() => setSelectedProject(project)}
          >
            <img src={project.image} alt={project.title} />
            <div className="tile-overlay">
              <h3>{project.title}</h3>
            </div>
          </div>
        ))}
      </div>
      {selectedProject && (
        <ProjectModal
          project={selectedProject}
          onClose={() => setSelectedProject(null)}
        />
      )}
    </section>
  );
}

export default Portfolio;
